import React from 'react';
import axios from 'axios';
// src/App.js - Near the top
import { BrowserRouter as Router, Routes, Route, useParams } from 'react-router-dom'; // <-- Add useParams here
import StudentRegister from './pages/StudentRegister';
import HomePage from './pages/HomePage';
import ClubRegister from './pages/ClubRegister';
import ClubLogin from './pages/ClubLogin';
import ClubSidebar from './pages/ClubSidebar';
import ClubDashboard from './pages/ClubDashboard';
import ClubEvents from './pages/ClubEvents';
import EventBooking from './pages/EventBooking';
import ApprovedEvents from './pages/ApprovedEvents';
import PendingEvents from './pages/PendingEvents';
import RejectedEvents from './pages/RejectedEvents';
import ClubRecruitments from './pages/ClubRecruitments';
import ClubMembers from './pages/ClubMembers';
import ClubProfile from './pages/ClubProfile';
import ClubSettings from './pages/ClubSettings';
import BudgetPage from './pages/BudgetPage';
import styles from './App.module.css';

// Placeholder for the Evaluation Page - Create this component later
const EvaluationPagePlaceholder = () => {
    const { clubId, semester } = useParams();
    return <div>Evaluation Page for Club {clubId}, Semester: {decodeURIComponent(semester)} (Placeholder)</div>;
};

axios.defaults.withCredentials = true;

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<HomePage />} />
                <Route path="/register-student" element={<StudentRegister />} />
                <Route path="/register-club" element={<ClubRegister />} />
                <Route path="/login-club" element={<ClubLogin />} />
                <Route path="/club/:clubId/*" element={<ClubLayout />} />
            </Routes>
        </Router>
    );
}

function ClubLayout() {
    const { clubId } = useParams();
    return (
        <div className={styles.dashboardContainer}> {/* Apply the grid layout here */}
            {/* Pass clubId to Sidebar if it needs it for generating links */}
            <ClubSidebar clubId={clubId} />
            <div className={styles.mainContentArea}> {/* New div for main content */}
                <Routes>
                    {/* Nested routes are relative to "/club/:clubId/" */}
                    <Route path="overview" element={<ClubDashboard />} /> {/* Matches /club/:clubId/overview */}
                    <Route path="events/*" element={<ClubEventsRoutes />} /> {/* Matches /club/:clubId/events/* */}
                    <Route path="recruitments" element={<ClubRecruitments />} /> {/* Matches /club/:clubId/recruitments */}
                    <Route path="members" element={<ClubMembers />} /> {/* Matches /club/:clubId/members */}
                    <Route path="profile" element={<ClubProfile />} /> {/* Matches /club/:clubId/profile */}
                    <Route path="settings" element={<ClubSettings />} /> {/* Matches /club/:clubId/settings */}

                    {/* Add the route for the Evaluation page */}
                    <Route path="evaluate/:semester" element={<EvaluationPagePlaceholder />} /> {/* Matches /club/:clubId/evaluate/:semester */}

                </Routes>
            </div>
        </div>
    );
}
function ClubEventsRoutes() {
    // If components inside ClubEventsRoutes need clubId, you can get it here too
    // const { clubId } = useParams(); // Already available from parent route match

   return (
       <Routes>
           {/* These paths are relative to "/club/:clubId/events/" */}
           <Route index element={<ClubEvents />} /> {/* Matches /club/:clubId/events/ */}
           <Route path="booking" element={<EventBooking />} /> {/* Matches /club/:clubId/events/booking */}
           <Route path="approved" element={<ApprovedEvents />} /> {/* etc. */}
           <Route path="pending" element={<PendingEvents />} />
           <Route path="rejected" element={<RejectedEvents />} />
           <Route path="budget/:eventId" element={<BudgetPage />} />
       </Routes>
   );
}
export default App;
